import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the featured products grid to be rendered
    await page.waitForSelector('#productsGrid .product-card', { timeout: 5000 });

    // Find the first product card and click it to open the Product Detail Modal
    const productCard = await page.$('#productsGrid .product-card');
    if (!productCard) throw new Error('No product card found in #productsGrid');
    await productCard.click();

    // Wait for the modal to appear (by id or class)
    await page.waitForSelector('#productModal', { timeout: 5000 });
    // Wait for modal to be visible (display: block)
    await page.waitForSelector('#productModal[style*="display: block"]', { timeout: 5000 });

    // Take screenshot of the opened modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal_open.png'));

    // Extract product title and price from the modal for verification
    const title = await page.$eval('#productDetail .product-detail-title', el => el.textContent.trim());
    const price = await page.$eval('#productDetail .product-detail-price', el => el.textContent.trim());

    return {
      success: true,
      action: "Opened the Product Detail Modal by clicking a product card and verified modal content.",
      extractedData: {
        productTitle: title,
        productPrice: price
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
